script: |
  super -f text -I q3352.spq | sort > q3352.out

inputs:
  - name: q3352.spq
    data: |
      SELECT DISTINCT - tab1.col0 * ( + 7 ) + + cor0.col1 * cor0.col0 AS col1 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0;
  - name: tab1
  - name: tab2

outputs:
